import classes from "./HourlyVariablesTab.module.css";
import { useEffect, useState } from "react";

const HourlyVariablesTab = (props) => {
  const [selectedCheckboxes, setSelectedCheckboxes] = useState(props.checkedVars);

  const handleCheckBoxChange = (event) => {
    if (event.target.checked) {
      const newSelectedCheckboxes = [...selectedCheckboxes, event.target.id];
      setSelectedCheckboxes(newSelectedCheckboxes);
    } else {
      const newSelectedCheckboxes = selectedCheckboxes.filter((id) => {
        return id !== event.target.id;
      });
      setSelectedCheckboxes(newSelectedCheckboxes);
    }
  };

  useEffect(() => {
    props.onHourlyDataChange(selectedCheckboxes);
  }, [selectedCheckboxes]);

  return (
    <>
      <h3>Hourly weather variables</h3>
      <div className={classes.variables}>
        <span>
          <input
            type="checkbox"
            id="temperature2m"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("temperature2m")}
          />
          <label htmlFor="temperature2m">Temperature (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="cloudcoverTotal"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("cloudcoverTotal")}
          />
          <label htmlFor="cloudcoverTotal">Cloudcover Total</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="windSpeed10m"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("windSpeed10m")}
          />
          <label htmlFor="windSpeed10m">Wind Speed (10m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="soilTemp0cm"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("soilTemp0cm")}
          />
          <label htmlFor="soilTemp0cm">Soil Temperature (0cm)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="relHumidity"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("relHumidity")}
          />
          <label htmlFor="relHumidity">Relative Humidity (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="cloudcoverLow"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("cloudcoverLow")}
          />
          <label htmlFor="cloudcoverLow">Cloudcover Low</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="windSpeed80m"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("windSpeed80m")}
          />
          <label htmlFor="windSpeed80m">Wind Speed (80m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="soilTemp6cm"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("soilTemp6cm")}
          />
          <label htmlFor="soilTemp6cm">Soil Temperature (6cm)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="dewPoint"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("dewPoint")}
          />
          <label htmlFor="dewPoint">Dew Point (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="cloudcoverMid"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("cloudcoverMid")}
          />
          <label htmlFor="cloudcoverMid">Cloudcover Mid</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="windSpeed120m"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("windSpeed120m")}
          />
          <label htmlFor="windSpeed120m">Wind Speed (120m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="soilTemp18cm"
            onChange={handleCheckBoxChange}
            checked={selectedCheckboxes.includes("soilTemp18cm")}
          />
          <label htmlFor="soilTemp18cm">Soil Temperature (18cm)</label>
        </span>
      </div>
    </>
  );
};

export default HourlyVariablesTab;
